import React from 'react';

function About() {
  return (
    <section className="about">
      <div className="container">
        <div className="about-text">
          <h2>Lei Guo</h2>
          <p>
            A real estate broker of Royal LePage Team Realty in Ottawa graduated with a Master of Management and Professional Accounting from the Rotman School of Management, University of Toronto, Lei is a well-respected Ottawa Agent, TOP 2% of Royal LePage's Realtors in Canada!
          </p>
          <button className="btn">Get Connected</button>
        </div>
        <div className="about-image">
          <img src="https://via.placeholder.com/400x400" alt="Lei Guo" />
        </div>
      </div>
    </section>
  );
}

export default About;
